import './App.css'
import MainDash from './components/MainDash/MainDash';
import Sidebar from './components/Sidebar';

function App() {
  return (
    <div className="App">
      <div className="AppGlass">
        <Sidebar/>
        <MainDash/>

        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Pro />
          </Route>
          <Route path="/dash">
            <MainDash />
          </Route>
        </Switch>

      </div>
    </div>
  );
}

export default App;
